import ModuleCard from "./ModuleCard";

const ModuleContrainer = () => {
  return (
    <div className="module-container">
      <ModuleCard key={"meshparticles"}/>
      <ModuleCard />
      <ModuleCard />
      <ModuleCard />
    </div>
  )
}

export default ModuleContrainer
